import React from "react";
import "./page-style/profile.css";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import userPic from "../assets/images/test.jpg";
import UserProducts from "../components/UserProduct";

export default function Profile() {
  const [productData, setProductData] = React.useState({});

  React.useEffect(() => {
    const getProduct = async () => {
      const res = await fetch(`http://localhost:3006/api/v1/user/1/products`);
      const data = await res.json();
      setProductData(data.data);
    };
    getProduct();
  }, []);

  const productsArray = productData.map((product) => (
    <UserProducts
      key={product.id}
      name={product.name}
      id={product.id}
      price={product.price}
    />
  ));
  return (
    <>
      <Navbar />
      <main className="container">
        <div className="user-data">
          <div className="user-pic">
            <img src={userPic} alt="user" />
          </div>
          <div className="user-data-content">
            <p className="name">Mazen Samer</p>
            <p className="mail">example@gmail.com</p>
          </div>
        </div>
        <div className="user-products">
          <p>My products</p>
          <br />
          <UserProducts />
          <UserProducts />
          <UserProducts />
          <UserProducts />
        </div>
      </main>
      <Footer />
    </>
  );
}
